    "If the course does not have an end date, learners always see their scores when they submit answers to assessments.": "Si el curs no t\u00e9 data de finalitzaci\u00f3, els estudiants sempre veuen les puntuacions quan envien respostes a les avaluacions.",
    "If the photos you submit are rejected, try moving the computer or camera orientation to change the lighting angle.  The most common reason for rejection is inability to read the text on the ID card.": "N\u1ebfu \u1ea3nh b\u1ea1n g\u1eedi b\u1ecb t\u1eeb ch\u1ed1i, h\u00e3y th\u1eed di chuy\u1ec3n m\u00e1y t\u00ednh ho\u1eb7c h\u01b0\u1edbng m\u00e1y \u1ea3nh \u0111\u1ec3 thay \u0111\u1ed5i g\u00f3c chi\u1ebfu s\u00e1ng. L\u00fd do t\u1eeb ch\u1ed1i ph\u1ed5 bi\u1ebfn nh\u1ea5t l\u00e0 kh\u00f4ng th\u1ec3 \u0111\u1ecdc \u0111\u01b0\u1ee3c ch\u1eef tr\u00ean th\u1ebb ID.",
    "If the subsection does not have a due date, learners always see their scores when they submit answers to assessments.": "Si la subsecci\u00f3 no t\u00e9 data de venciment, els estudiants sempre veuen les puntuacions quan envien respostes a les avaluacions.",
    "If the unit was previously published and released to learners, any changes you made to the unit when it was hidden will now be visible to learners.": "Si la unitat es va publicar i es va publicar pr\u00e8viament als estudiants, els canvis que h\u00e0giu fet a la unitat quan estigu\u00e9s oculta ara seran visibles per als estudiants.",
    "If the unit was previously published and released to students, any changes you made to the unit when it was hidden will now be visible to students. Do you want to proceed?": "N\u1ebfu \u0111\u01a1n v\u1ecb n\u00e0y \u0111\u00e3 \u0111\u01b0\u1ee3c xu\u1ea5t b\u1ea3n v\u00e0 ph\u00e1t h\u00e0nh cho h\u1ecdc vi\u00ean, c\u00e1c thay \u0111\u1ed5i m\u00e0 b\u1ea1n \u0111\u00e3 th\u1ef1c hi\u1ec7n tr\u00ean \u0111\u01a1n v\u1ecb khi n\u00f3 \u0111\u01b0\u1ee3c \u1ea9n s\u1ebd \u0111\u01b0\u1ee3c hi\u1ec7n l\u00ean \u0111\u1ed1i v\u1edbi h\u1ecdc vi\u00ean. B\u1ea1n c\u00f3 mu\u1ed1n ti\u1ebfp t\u1ee5c?",
    "If you do not yet have an account, use the button below to register.": "Si encara no teniu un compte, utilitzeu el bot\u00f3 seg\u00fcent per registrar-se.",
    "If you leave, you can no longer post in this team's discussions.Your place will be available to another learner.": "N\u1ebfu b\u1ea1n r\u1eddi \u0111i, b\u1ea1n kh\u00f4ng th\u1ec3 \u0111\u0103ng b\u00e0i trong c\u00e1c cu\u1ed9c th\u1ea3o lu\u1eadn c\u1ee7a nh\u00f3m n\u00e0y n\u1eefa. V\u1ecb tr\u00ed c\u1ee7a b\u1ea1n s\u1ebd d\u00e0nh cho ng\u01b0\u1eddi h\u1ecdc kh\u00e1c.",
    "If you make significant changes, make sure you notify members of the team before making these changes.": "Trong tr\u01b0\u1eddng h\u1ee3p b\u1ea1n mu\u1ed1n t\u1ea1o ra nh\u1eefng thay \u0111\u1ed5i l\u1edbn, b\u1ea1n n\u00ean th\u00f4ng b\u00e1o tr\u01b0\u1edbc v\u1edbi c\u00e1c th\u00e0nh vi\u00ean c\u1ee7a nh\u00f3m v\u1ec1 nh\u1eefng thay \u0111\u1ed5i n\u00e0y.",
    "If you make this %(xblockType)s visible to learners, learners will be able to see its content after the release date has passed and you have published the unit. Only units that are explicitly hidden from learners will remain hidden after you clear this option for the %(xblockType)s.": "Si fa que aquest %(xblockType)s sigui visible per als estudiants, els aprenents podran veure el seu contingut despr\u00e9s de la data de llan\u00e7ament i han publicat la unitat. Nom\u00e9s les unitats que estan expl\u00edcitament amagades pels aprenents romandran ocultes despr\u00e9s d'esborrar aquesta opci\u00f3 per a %(xblockType)s.",
    "If you proceed, you will be unable to use this account to take courses on the {platformName} app, {siteName}, or any other site hosted by {platformName}.": "N\u1ebfu ti\u1ebfp t\u1ee5c, b\u1ea1n s\u1ebd kh\u00f4ng th\u1ec3 s\u1eed d\u1ee5ng t\u00e0i kho\u1ea3n n\u00e0y \u0111\u1ec3 tham gia c\u00e1c kh\u00f3a h\u1ecdc tr\u00ean \u1ee9ng d\u1ee5ng {platformName} {siteName}, ho\u1eb7c b\u1ea5t k\u1ef3 trang web n\u00e0o kh\u00e1c do {platformName} l\u01b0u tr\u1eef.",
    "If you remove this transcript, the transcript will not be available for any components that use this video.": "Si elimineu aquesta transcripci\u00f3, la transcripci\u00f3 no estar\u00e0 disponible per als components que utilitzin aquest v\u00eddeo.",
    "If you remove this transcript, the transcript will not be available for this component.": "N\u1ebfu b\u1ea1n x\u00f3a b\u1ea3ng \u0111i\u1ec3m n\u00e0y, b\u1ea3ng \u0111i\u1ec3m s\u1ebd kh\u00f4ng kh\u1ea3 d\u1ee5ng cho th\u00e0nh ph\u1ea7n n\u00e0y.",
    "If you require assistance with taking either photo for submission, contact %(platformName)s support for additional suggestions.": "N\u1ebfu b\u1ea1n c\u1ea7n h\u1ed7 tr\u1ee3 ch\u1ee5p m\u1ed9t trong hai b\u1ee9c \u1ea3nh \u0111\u1ec3 g\u1eedi, h\u00e3y li\u00ean h\u1ec7 v\u1edbi b\u1ed9 %(platformName)s \u0111\u1ec3 c\u00f3 th\u00eam \u0111\u1ec1 xu\u1ea5t.",
    "If you select an option other than \"%(hide_label)s\", published units in this subsection become available to learners unless they are explicitly hidden.": "Si seleccioneu una opci\u00f3 diferent \"%(hide_label)s\", les unitats publicades en aquesta subsecci\u00f3 estaran disponibles per als estudiants, tret que estiguin expl\u00edcitament amagades.",
    "If you still wish to continue and delete your account, please enter your account password:": "N\u1ebfu b\u1ea1n v\u1eabn mu\u1ed1n ti\u1ebfp t\u1ee5c v\u00e0 x\u00f3a t\u00e0i kho\u1ea3n c\u1ee7a m\u00ecnh, vui l\u00f2ng nh\u1eadp m\u1eadt kh\u1ea9u t\u00e0i kho\u1ea3n c\u1ee7a b\u1ea1n:",
    "If you use the Advanced Editor, this problem will be converted to XML and you will not be able to return to the Simple Editor Interface.\n\nProceed to the Advanced Editor and convert this problem to XML?": "N\u1ebfu b\u1ea1n s\u1eed d\u1ee5ng b\u1ed9 so\u1ea1n th\u1ea3o cao c\u1ea5p, b\u00e0i t\u1eadp n\u00e0y s\u1ebd \u0111\u01b0\u1ee3c chuy\u1ec3n sang \u0111\u1ecbnh d\u1ea1ng XML v\u00e0 b\u1ea1n s\u1ebd kh\u00f4ng th\u1ec3 quay tr\u1edf l\u1ea1i b\u1ed9 so\u1ea1n th\u1ea3o \u0111\u01a1n gi\u1ea3n \u0111\u01b0\u1ee3c n\u1eefa.\n\nB\u1ea1n c\u00f3 mu\u1ed1n s\u1eed d\u1ee5ng b\u1ed9 so\u1ea1n th\u1ea3o cao c\u1ea5p v\u00e0 chuy\u1ec3n \u0111\u1ecbnh d\u1ea1ng b\u00e0i t\u1eadp th\u00e0nh XML?",
