    "You may also lose access to verified certificates and other program credentials like MicroMasters certificates. If you want to make a copy of these for your records before proceeding with deletion, follow the instructions for {htmlStart}printing or downloading a certificate{htmlEnd}.": "B\u1ea1n c\u0169ng c\u00f3 th\u1ec3 m\u1ea5t quy\u1ec1n truy c\u1eadp v\u00e0o c\u00e1c ch\u1ee9ng ch\u1ec9 \u0111\u00e3 \u0111\u01b0\u1ee3c x\u00e1c minh v\u00e0 th\u00f4ng tin \u0111\u0103ng nh\u1eadp ch\u01b0\u01a1ng tr\u00ecnh kh\u00e1c nh\u01b0 ch\u1ee9ng ch\u1ec9 MicroMasters. N\u1ebfu b\u1ea1n mu\u1ed1n t\u1ea1o m\u1ed9t b\u1ea3n sao n\u00e0y cho h\u1ed3 s\u01a1 c\u1ee7a m\u00ecnh tr\u01b0\u1edbc khi ti\u1ebfn h\u00e0nh x\u00f3a, h\u00e3y l\u00e0m theo c\u00e1c h\u01b0\u1edbng d\u1eabn \u0111\u1ec3 {htmlStart}in ho\u1eb7c t\u1ea3i xu\u1ed1ng ch\u1ee9ng ch\u1ec9{htmlEnd}.",
    "You may be able to complete the image capture procedure without assistance, but it may take a couple of submission attempts to get the camera positioning right.  Optimal camera positioning varies with each computer, but generally the best position for a headshot is approximately 12-18 inches (30-45 centimeters) from the camera, with your head centered relative to the computer screen. ": "B\u1ea1n c\u00f3 th\u1ec3 ho\u00e0n th\u00e0nh quy tr\u00ecnh ch\u1ee5p \u1ea3nh m\u00e0 kh\u00f4ng c\u1ea7n h\u1ed7 tr\u1ee3, nh\u01b0ng c\u00f3 th\u1ec3 m\u1ea5t m\u1ed9t v\u00e0i l\u1ea7n g\u1eedi \u0111\u1ec3 x\u00e1c \u0111\u1ecbnh \u0111\u00fang v\u1ecb tr\u00ed m\u00e1y \u1ea3nh. V\u1ecb tr\u00ed m\u00e1y \u1ea3nh t\u1ed1i \u01b0u kh\u00e1c nhau t\u00f9y theo t\u1eebng m\u00e1y t\u00ednh, nh\u01b0ng n\u00f3i chung v\u1ecb tr\u00ed t\u1ed1t nh\u1ea5t cho \u1ea3nh ch\u1ee5p ch\u00ednh x\u00e1c l\u00e0 c\u00e1ch m\u00e1y \u1ea3nh kho\u1ea3ng 12-18 inch (30-45 cm), v\u1edbi t\u00e2m c\u1ee7a b\u1ea1n so v\u1edbi m\u00e0n h\u00ecnh m\u00e1y t\u00ednh.",
    "You may be able to complete the image capture procedure without assistance, but it may take a couple of submission attempts to get the camera positioning right.  Optimal camera positioning varies with each computer, but generally, the best position for a photo of an ID card is 8-12 inches (20-30 centimeters) from the camera, with the ID card centered relative to the camera. ": "B\u1ea1n c\u00f3 th\u1ec3 ho\u00e0n th\u00e0nh quy tr\u00ecnh ch\u1ee5p \u1ea3nh m\u00e0 kh\u00f4ng c\u1ea7n h\u1ed7 tr\u1ee3, nh\u01b0ng c\u00f3 th\u1ec3 m\u1ea5t m\u1ed9t v\u00e0i l\u1ea7n g\u1eedi \u0111\u1ec3 x\u00e1c \u0111\u1ecbnh \u0111\u00fang v\u1ecb tr\u00ed m\u00e1y \u1ea3nh. V\u1ecb tr\u00ed m\u00e1y \u1ea3nh t\u1ed1i \u01b0u kh\u00e1c nhau t\u00f9y theo t\u1eebng m\u00e1y t\u00ednh, nh\u01b0ng nh\u00ecn chung, v\u1ecb tr\u00ed t\u1ed1t nh\u1ea5t \u0111\u1ec3 ch\u1ee5p \u1ea3nh th\u1ebb ID l\u00e0 c\u00e1ch m\u00e1y \u1ea3nh 8-12 inch (20-30 cm), v\u1edbi th\u1ebb ID c\u0103n gi\u1eefa so v\u1edbi m\u00e1y \u1ea3nh.",
